import  "./header.css";

export default function Header() {
    return (
        <section className="headerWrapper">
            <h6>Back</h6>

            <header>
               <h4 className="headerTitle">World's News</h4>
               <p className="headerSubtitle">See more</p>
           </header>
        </section>
    );
}
